mongodb: count occurrences in two columns<p>I have a collection that has four columns: <code>object1, object2, selectedObject, unselectedObject</code>. <code>object1</code> and <code>object2</code> are two random objects from a collection (the collection contains the results of various matchups between two objects each time). I want to create a pipeline that shows for each distinct object in the <code>object1</code> column, how many times it appeared in the <code>selectedObject</code> column, and how many times it appeared in the <code>unselectedObject</code> column. Grouping and filtering according to just one column seems easy enough, but I want to display the results from both columns side by side, and various methods I tried for doing so failed.</p>
<p>For example, if the collection I have is:</p>
<pre><code>{ID: 1, Object1: A, Object2: B, selected: A, Unselected: B}
{ID: 1, Object1: A, Object2: C, selected: C, Unselected: A}
{ID: 1, Object1: A, Object2: B, selected: B, Unselected: A}
{ID: 1, Object1: B, Object2: A, selected: B, Unselected: A}
{ID: 1, Object1: A, Object2: C, selected: C, Unselected: A}
{ID: 1, Object1: C, Object2: A, selected: C, Unselected: A}
</code></pre>
<p>I would like the output to be something like:</p>
<pre><code>{ Object: A, Selected: 1, Unselected: 5}
{ Object: B, Selected: 2, Unselected: 1}
{ Object: A, Selected: 3, Unselected: 0}
</code></pre>

