Performance of mongo request for rain/sunshine/raindays on weekends<p>I want to know:</p>
<ul>
<li>sum of rain (mm)</li>
<li>sum of sunshine (hours)</li>
<li>Probability (%) of a rainday with more than 0.5mm rain on weekends</li>
</ul>
<p>On the weekends (sa+so) between week 20 to 40 for the last 17years.</p>
<p>I have 820k documents in 10min periods.
The request took sometimes 38sec but sometimes more than 1min.</p>
<p>Do you have an Idea how to improve performance?</p>
<p>data-Model:</p>
<pre><code>[
  'datum',
  'regen',
  'tempAussen',
  'sonnenSchein',
  and more...
]
</code></pre>
<p>schema:</p>
<pre><code>[
      {
        $project: {
          jahr: {
            $year: {
              date: '$datum',
              timezone: 'Europe/Berlin',
            },
          },
          woche: {
            $week: {
              date: '$datum',
              timezone: 'Europe/Berlin',
            },
          },
          day: {
            $isoDayOfWeek: {
              date: '$datum',
              timezone: 'Europe/Berlin',
            },
          },
          stunde: {
            $hour: {
              date: '$datum',
              timezone: 'Europe/Berlin',
            },
          },
          tagjahr: {
            $dayOfYear: {
              date: '$datum',
              timezone: 'Europe/Berlin',
            },
          },
          tempAussen: 1,
          regen: 1,
          sonnenSchein: 1,
        },
      },
      {
        $match: {
          $and: [
            {
              woche: {
                $gte: 20,
              },
            },
            {
              woche: {
                $lte: 40,
              },
            },
            {
              day: {
                $gte: 6,
              },
            },
          ],
        },
      },
      {
        $group: {
          _id: ['$tagjahr', '$jahr'],
          woche: {
            $first: '$woche',
          },
          regen_sum: {
            $sum: '$regen',
          },
          sonnenSchein_sum: {
            $sum: '$sonnenSchein',
          },
        },
      },
      {
        $project: {
          _id: '$_id',
          regenTage: {
            $sum: {
              $cond: {
                if: {
                  $gte: ['$regen_sum', 0.5],
                },
                then: 1,
                else: 0,
              },
            },
          },
          woche: 1,
          regen_sum: 1,
          sonnenSchein_sum: 1,
        },
      },
      {
        $group: {
          _id: '$woche',
          regen_sum: {
            $sum: '$regen_sum',
          },
          sonnenSchein_sum: {
            $sum: '$sonnenSchein_sum',
          },
          regenTage: {
            $sum: '$regenTage',
          },
        },
      },
      {
        $project: {
          regenTage: 1,
          regen_sum: {
            $divide: ['$regen_sum', 34],
          },
          sonnenSchein_sum: {
            $divide: ['$sonnenSchein_sum', 2040],
          },
          probability: {
            $divide: ['$regenTage', 0.34],
          },
        },
      },
      {
        $project: {
          regen_sum: {
            $round: ['$regen_sum', 1],
          },
          sonnenSchein_sum: {
            $round: ['$sonnenSchein_sum', 1],
          },
          wahrscheinlich: {
            $round: ['$probability', 0],
          },
        },
      },
      {
        $sort: {
          _id: 1,
        },
      },
    ] 
</code></pre>
<p>this result is an example for week 20:
on the weekend of calender week 20 I have in average 2.3mm rain, 11.9h sunshine and a probility of 35% that it will rain atleast on one day of the weekend</p>
<pre><code>_id:20
regen_sum:2.3
sonnenSchein_sum:11.9
probability:35
</code></pre>

